import React from 'react';

const SearchNavbar = () => {
  return (
    <nav style={styles.navbar}>
      <input
        type="text"
        placeholder="Search books..."
        style={styles.searchInput}
      />
    </nav>
  );
};

const styles = {
  navbar: {
    backgroundColor: '#333',
    padding: '10px 30px',
    position: 'fixed',
    width: '100%',
    top: 0,
    zIndex: 1000,
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
  },
  searchInput: {
    width: '60%',
    maxWidth: '500px',
    padding: '8px 12px',
    borderRadius: '4px',
    border: '1px solid #ccc',
    fontSize: '14px',
  },
};

export default SearchNavbar;
